import React from "react";

const ProjectContainer = ({ articlename, articleimage }) => {
    return (
        <div class="projects__item">
            <picture class="projects__picture">
                <source media="(min-width: 62.5em)" srcSet={`/assets/images/${articleimage}`} />
                <img class="projects__image" src={`/assets/images/${articleimage}`}
                    alt="screenshot of design portfolio website" width="343" height="253" />
            </picture>
            <h3 class="projects__name">{articlename}</h3>
            <div class="projects__links">
                <a href="#" class="underline">Read Article</a>
            </div>
        </div>
    );
};

export default ProjectContainer;
